import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
  const style = {
    color: "#ffffff",
    backgroundColor: "#040404",
    margin: "auto",
    padding: "10px",
    display: "flex",
    justifyContent: "space-between",
    textDecoration: "none",
    fontSize: "20px",
    boxShadow: "0px 5px #000000",
  };

  return (
    <>
      <div style={style}>
        <div style={style}>
          <Link to="/">Home</Link>
        </div>
        <div style={style}>
          <Link to="/order">Order</Link>
        </div>
      </div>
    </>
  );
}

export default NavBar;
